import React from "react"

class Header extends React.Component { 
  render() {
    return (
      <header>
        <span className="logo">REKS</span>
        <ul className = "nav">
                <li>Про нас</li>
                <li>Услуги</li>
                <li>Почему мы?</li>
                <li>Специалисты клиники</li>
                <li>Отзывы</li>
                <li>Контакты</li>
            </ul>
      </header>
    )
  }
}

export default Header
